import { useEffect, useState } from 'react';
import { supabase } from './supabase';
import { useNavigate } from 'react-router-dom';
import {
  Typography,
  Button,
  Container,
  Box,
  Divider,
  CircularProgress,
  Paper,
  List,
  ListItem,
  ListItemText,
  IconButton,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  TextField
} from '@mui/material';
import { Delete as DeleteIcon, Edit as EditIcon } from '@mui/icons-material';

function Dashboard() {
  const [ownedProjects, setOwnedProjects] = useState([]);
  const [invitedProjects, setInvitedProjects] = useState([]);
  const [userEmail, setUserEmail] = useState('');
  const [loading, setLoading] = useState(true);
  const [editDialogOpen, setEditDialogOpen] = useState(false);
  const [projectToEdit, setProjectToEdit] = useState(null);
  const [editFields, setEditFields] = useState({
    project_name: '',
    start_date: '',
    end_date: ''
  });

  const navigate = useNavigate();

  useEffect(() => {
    const fetchProjects = async () => {
      const { data: userData } = await supabase.auth.getUser();
      const user = userData?.user;

      if (!user) {
        navigate('/login');
        return;
      }

      setUserEmail(user.email);

      const { data: owned } = await supabase
        .from('projects')
        .select('*')
        .eq('owner_id', user.id);

      setOwnedProjects(owned || []);

      const { data: invites } = await supabase
        .from('invitations')
        .select('project_id')
        .eq('invited_email', user.email);

      const projectIds = invites.map(i => i.project_id);

      let invited = [];
      if (projectIds.length > 0) {
        const { data: invitedProjects } = await supabase
          .from('projects')
          .select('*')
          .in('id', projectIds);

        invited = invitedProjects || [];
      }

      setInvitedProjects(invited);
      setLoading(false);
    };

    fetchProjects();
  }, [navigate]);

  const handleDelete = async (projectId) => {
    const confirmed = window.confirm('Are you sure you want to delete this project? This action cannot be undone.');
    if (!confirmed) return;

    const { error } = await supabase
      .from('projects')
      .delete()
      .eq('id', projectId);

    if (error) {
      console.error('Error deleting project:', error.message);
      alert('Failed to delete project.');
    } else {
      setOwnedProjects(prev => prev.filter(p => p.id !== projectId));
      alert('Project deleted successfully.');
    }
  };

  const openEditDialog = (project) => {
    setProjectToEdit(project);
    setEditFields({
      project_name: project.project_name,
      start_date: project.start_date,
      end_date: project.end_date
    });
    setEditDialogOpen(true);
  };

  const handleEditFieldChange = (field, value) => {
    setEditFields(prev => ({ ...prev, [field]: value }));
  };

  const handleSaveEdit = async () => {
    const { error } = await supabase
      .from('projects')
      .update({
        project_name: editFields.project_name,
        start_date: editFields.start_date,
        end_date: editFields.end_date
      })
      .eq('id', projectToEdit.id);

    if (error) {
      alert('Failed to update project');
      return;
    }

    setOwnedProjects(prev =>
      prev.map(p =>
        p.id === projectToEdit.id
          ? { ...p, ...editFields }
          : p
      )
    );

    setEditDialogOpen(false);
    alert('Project updated successfully.');
  };

  return (
    <Container maxWidth="md" sx={{ mt: 5 }}>
      <Typography variant="h4" gutterBottom>Welcome to Your Dashboard</Typography>
      <Typography variant="body1" sx={{ mb: 4 }}>Logged in as: <strong>{userEmail}</strong></Typography>

      <Box sx={{ mb: 4 }}>
        <Button variant="contained" onClick={() => navigate('/create-project')}>
          + Create New Project
        </Button>
      </Box>

      {loading ? (
        <CircularProgress />
      ) : (
        <>
          <Paper sx={{ p: 2, mb: 4 }}>
            <Typography variant="h6">Your Projects</Typography>
            <Divider sx={{ mb: 1 }} />
            {ownedProjects.length === 0 ? (
              <Typography variant="body2">You haven’t created any projects yet.</Typography>
            ) : (
              <List>
                {ownedProjects.map((project) => (
                  <ListItem
                    key={project.id}
                    secondaryAction={
                      <>
                        <IconButton onClick={() => openEditDialog(project)}>
                          <EditIcon />
                        </IconButton>
                        <IconButton color="error" onClick={() => handleDelete(project.id)}>
                          <DeleteIcon />
                        </IconButton>
                      </>
                    }
                  >
                    <ListItemText
                      primary={project.project_name}
                      secondary={`Start: ${project.start_date} — End: ${project.end_date}`}
                    />
                  </ListItem>
                ))}
              </List>
            )}
          </Paper>

          <Paper sx={{ p: 2 }}>
            <Typography variant="h6">Projects You’ve Been Invited To</Typography>
            <Divider sx={{ mb: 1 }} />
            {invitedProjects.length === 0 ? (
              <Typography variant="body2">No invitations yet.</Typography>
            ) : (
              <List>
                {invitedProjects.map((project) => (
                  <ListItem key={project.id}>
                    <ListItemText
                      primary={project.project_name}
                      secondary={`Start: ${project.start_date} — End: ${project.end_date}`}
                    />
                  </ListItem>
                ))}
              </List>
            )}
          </Paper>
        </>
      )}

      <Dialog open={editDialogOpen} onClose={() => setEditDialogOpen(false)}>
        <DialogTitle>Edit Project</DialogTitle>
        <DialogContent>
          <TextField
            label="Project Name"
            fullWidth
            margin="normal"
            value={editFields.project_name}
            onChange={(e) => handleEditFieldChange('project_name', e.target.value)}
          />
          <TextField
            label="Start Date"
            type="date"
            fullWidth
            margin="normal"
            InputLabelProps={{ shrink: true }}
            value={editFields.start_date}
            onChange={(e) => handleEditFieldChange('start_date', e.target.value)}
          />
          <TextField
            label="End Date"
            type="date"
            fullWidth
            margin="normal"
            InputLabelProps={{ shrink: true }}
            value={editFields.end_date}
            onChange={(e) => handleEditFieldChange('end_date', e.target.value)}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setEditDialogOpen(false)}>Cancel</Button>
          <Button variant="contained" onClick={handleSaveEdit}>Save</Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
}

export default Dashboard;
